def construct_filters(idx):
    # idx is current match's index
    # the first match has idx of zero
    # idx = 1000
    filterset = set()
    # if idx <= 10:
    #     return filters
    for lookback in [5, 10, 20]:
        for step in [1, 2, 3]:
            first = max(0, idx - step * lookback)
            filter = list(range(first, idx, step))
            # print('idx', idx, 'lookback', lookback, 'step', step, filter)
            filterset.add(','.join([str(x) for x in filter]))
    # print('#filters', len(filterset))
    filterlist = list(filterset)
    filters = [x.split(',') for x in filterlist]
    return filters

# construct_filters(10)

def get_top_card_probability(cards, LIKELIMAP):
    # cards = ['R', 'P', 'P', 'S', 'S', 'S'] * 10
    countmap = {'R': 0, 'P': 0, 'S': 0}
    for card in cards:
        countmap[card] += 1
    top_count = max(countmap.values())
    top_card = ''
    total_cards = 0
    for c, n in countmap.items():
        if n == top_count:
            top_card = c
        total_cards += n
    # print('total_cards', total_cards, 'high card', top_card, top_count)
    amap = LIKELIMAP[total_cards]
    top_count = max(amap['L'], min(amap['H'], top_count))
    top_probability = amap[top_count]
    # print('top_card', top_card, 'top_probability', top_probability)
    return top_card, top_probability


def compute_my_card(your_card):
    return {'R': 'P', 'P': 'S', 'S': 'R'}[your_card]

def compute_your_card(filters, ycards, LIKELIMAP):
    # filters = construct_filters(100)
    top_card = ''
    min_probability = 10000
    for filter in filters:
        # filter = filters[2]
        # ycards = ['R', 'P', 'P', 'S', 'S', 'S'] * 200
        afilter = [int(x) for x in filter]
        selected = [ycards[i] for i in afilter]
        card, prob = get_top_card_probability(selected, LIKELIMAP)
        if prob < min_probability:
            top_card = card
            min_probability = prob
    # print(top_card, min_probability)
    return top_card

